import React from 'react';

const AdminOrdersList = () => {
    return (
        <div className="orders_lists">
            <h5 className="list_titl">
                KEY
            </h5>
                <p className="ord_lists_field1">USER EMAIL</p>
                <p className="ord_lists_field2">ORDER ID</p>
                <p className="ord_lists_field3">RECEIVERS NAME</p>
                <p className="ord_lists_field4">RECEIVERS PHONE NO</p>
                <p className="ord_lists_field5">PICKUP ADDRESS</p>
                <p className="ord_lists_field6">DESTINATION ADDRESS</p>
                <p className="ord_lists_field7">ORDER DATE</p>
                <p className="ord_lists_field8">STATUS</p>
                <p className="ord_lists_field9">CURRENT LOCATION</p>
        </div>
    );
}

export default AdminOrdersList;
